import React from 'react';

const Header: React.FC = () => {
    const isMobile = (/Mobi/i.test(window.navigator.userAgent));
    return (
        <div className={isMobile ? 'mobile_header' : 'web_header'}>
            <h2>해외여행자 보험</h2>
        </div>
    );
};

export default Header;
